ChatGPT has been designed for conversation with people, whereas Instructional is specifically intended to teach people skills or knowledge.

Both models can be used in a variety of settings, but chatgpt allows more conversational interaction because it can generate free-form natural language responses.  Instructional gpt requires that input (a training text) consist only of declarative information so it can learn directly from these texts instead using reinforcement learning where examples of how things work are needed to understand the concepts being taught.

